import React from 'react';

export const Header = (props) => {
  return (
    <div style={styles.headerStyle}>
      {props.children}
    </div>
  );
};

const styles = {
  headerStyle: {
    position: 'sticky',
    top: 0,
    padding: 10,
    height: 53,
    width: 'auto',
    borderBottom: '.1px solid grey',
    zIndex: 10,
  },
};
